import React from 'react';
import styled from 'styled-components';

const RightbarContainer = styled.div`
  flex: 3.5;
`;

const RightbarWrapper = styled.div`
  padding: 20px 20px 0 0;
`;

const BirthdayContainer = styled.div`
  display: flex;
  align-items: center;
`;

const BirthdayImg = styled.img`
  width: 40px;
  height: 40px;
  margin-right: 10px;
`;

const BirthdayText = styled.span`
  font-weight: 300;
  font-size: 15px;
`;

const RightbarAd = styled.img`
  width: 100%;
  border-radius: 10px;
  margin: 30px 0;
`;

const RightbarTitle = styled.h4`
  margin-bottom: 20px;
  font-size: 18px;
  font-weight: 500;
`;

const RightbarFriendList = styled.ul`
  padding: 0;
  margin: 0;
  list-style: none;
`;

const RightbarInfo = styled.div`
  margin-bottom: 30px;
`;

const RightbarInfoItem = styled.div`
  margin-bottom: 10px;
`;

const RightbarInfoKey = styled.span`
  font-weight: 500;
  margin-right: 15px;
  color: #555;
`;

const RightbarInfoValue = styled.span`
  font-weight: 300;
`;

const RightbarFollowings = styled.div`
  display: flex;
  flex-wrap: wrap;
  justify-content: space-between;
`;

const RightbarFollowing = styled.div`
  display: flex;
  flex-direction: column;
  margin-bottom: 20px;
  cursor: pointer;
`;

const RightbarFollowingImg = styled.img`
  width: 100px;
  height: 100px;
  object-fit: cover;
  border-radius: 5px;
`;

export default function Rightbar({ user }) {
  return (
    <RightbarContainer>
      <RightbarWrapper>
        <BirthdayContainer>
          <BirthdayImg src="assets/gift.png" alt="" />
          <BirthdayText>
            <b>Pola Foster</b> and <b>3 other friends</b> have a birthday today.
          </BirthdayText>
        </BirthdayContainer>
        <RightbarAd src="assets/ad.png" alt="" />
        <RightbarTitle>User Information</RightbarTitle>
        <RightbarInfo>
          <RightbarInfoItem>
            <RightbarInfoKey>City:</RightbarInfoKey>
            <RightbarInfoValue>New York</RightbarInfoValue>
          </RightbarInfoItem>
          <RightbarInfoItem>
            <RightbarInfoKey>From:</RightbarInfoKey>
            <RightbarInfoValue>Madrid</RightbarInfoValue>
          </RightbarInfoItem>
          <RightbarInfoItem>
            <RightbarInfoKey>Relationship:</RightbarInfoKey>
            <RightbarInfoValue>Single</RightbarInfoValue>
          </RightbarInfoItem>
        </RightbarInfo>
        <RightbarTitle>User Friends</RightbarTitle>
        <RightbarFollowings>
          <RightbarFollowing>
            <RightbarFollowingImg src="assets/person/1.jpeg" alt="" />
            <span>John Carter</span>
          </RightbarFollowing>
          <RightbarFollowing>
            <RightbarFollowingImg src="assets/person/2.jpeg" alt="" />
            <span>John Doe</span>
          </RightbarFollowing>
          <RightbarFollowing>
            <RightbarFollowingImg src="assets/person/3.jpeg" alt="" />
            <span>John Smith</span>
          </RightbarFollowing>
          <RightbarFollowing>
            <RightbarFollowingImg src="assets/person/4.jpeg" alt="" />
            <span>John Wick</span>
          </RightbarFollowing>
        </RightbarFollowings>
      </RightbarWrapper>
    </RightbarContainer>
  );
}
